import React from "react";

const photoshop_img = () => (
  <div>
    <img src="images/skills/photoshop/photoshop_icon.png" />
  </div>
);

const photoshop = {
  title: "Photoshop",
  icon: photoshop_img,
  svg_icon: null,
  value: "70"
};

export default photoshop;
